package Lec_02;
import java.util.*;
public class pattern_01 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner sc=new Scanner(System.in);
	int n=sc.nextInt();
	int i=1;
	while(i<=n) {
		int m=5;
		while(m>=1) {
			System.out.print ("*" + " ");
			m--;
		}	
		i++;
		System.out.println();
	}
	
	
	}

}
